(271, 1000, 1, 'What is nQuire?', 'nQuire is a web site to help <b>you</b> with your investigation.\r\n\r\nIt can help you in many ways. Here’s a few:\r\n<ul>\r\n<li>it’s a place where you can store files and URLs that you think will help in your investigation\r\n<li>it shows you what you need to do, when you need to do it, where, and who you need to do it with\r\n<li>it gives you a space where you can type in your hypothesis or question\r\n<li>it lets you decide how you want to do the investigation, such as the data you want to collect, where from, how often. Or choosing the equipment you want to use\r\n<li>it’s a place where you can put and store all your data \r\n<li>it can convert your data into tables and graphs so you can see what you have found out\r\n<li>there’s also a page where you can make notes about how you are getting on\r\n</ul>\r\nSo, log in and find out more.\r\n\r\nIf you are carrying out an investigation and you have been given a login and a password, click on the link in left hand menu bar to go to your investigations. \r\n\r\nIf you don''t have a login and password but are starting an investigation, ask your teacher or technical support to help you.\r\n\r\nIf you''re a visitor and you are interested in finding out more about the nQuire tool and the Personal Inquiry project, click <a href="http://www.nquire.org.uk">here</a>.\r\n\r\n', 'nQuire is a web site to help <b>you</b> with your investigation.\r\n\r\nIt can help you in many ways. Here’s a few:\r\n<ul>\r\n<li>it’s a place where you can store files and URLs that you think will help in your investigation\r\n<li>it shows you what you need to do, when you need to do it, where, and who you need to do it with\r\n<li>it gives you a space where you can type in your hypothesis or question\r\n<li>it lets you decide how you want to do the investigation, such as the data you want to collect, where from, how often. Or choosing the equipment you want to use\r', '', 1275410503, 2),
(271, 1001, 1, 'What is nQuire?', 'nQuire is a web site to help <b>you</b> with your investigation.\r\n\r\nIt can help you in many ways. Here’s a few:\r\n<ul>\r\n<li>it’s a place where you can store files and URLs that you think will help in your investigation\r\n<li>it shows you what you need to do, when you need to do it, where, and who you need to do it with\r\n<li>it gives you a space where you can type in your hypothesis or question\r\n<li>it lets you decide how you want to do the investigation, such as the data you want to collect, where from, how often. Or choosing the equipment you want to use\r\n<li>it’s a place where you can put and store all your data \r\n<li>it can convert your data into tables and graphs so you can see what you have found out\r\n<li>there’s also a page where you can make notes about how you are getting on\r\n</ul>\r\nSo, log in and find out more.\r\n\r\nIf you are carrying out an investigation and you have been given a login and a password, click on the link in left hand menu bar to go to your investigations. \r\n\r\nIf you don''t have a login and password but are starting an investigation, ask your teacher or technical support to help you.\r\n\r\nIf you''re a visitor and you are interested in finding out more about the nQuire tool and the Personal Inquiry project, click <a href="http://www.nquire.org.uk">here</a>.\r\n<!--break-->\r\n', 'nQuire is a web site to help <b>you</b> with your investigation.\r\n\r\nIt can help you in many ways. Here’s a few:\r\n<ul>\r\n<li>it’s a place where you can store files and URLs that you think will help in your investigation\r\n<li>it shows you what you need to do, when you need to do it, where, and who you need to do it with\r\n<li>it gives you a space where you can type in your hypothesis or question\r\n<li>it lets you decide how you want to do the investigation, such as the data you want to collect, where from, how often. Or choosing the equipment you want to use\r\n<li>it’s a place where you can put and store all your data \r\n<li>it can convert your data into tables and graphs so you can see what you have found out\r\n<li>there’s also a page where you can make notes about how you are getting on\r\n</ul>\r\nSo, log in and find out more.\r\n\r\nIf you are carrying out an investigation and you have been given a login and a password, click on the link in left hand menu bar to go to your investigations. \r\n\r\nIf you don''t have a login and password but are starting an investigation, ask your teacher or technical support to help you.\r\n\r\nIf you''re a visitor and you are interested in finding out more about the nQuire tool and the Personal Inquiry project, click <a href="http://www.nquire.org.uk">here</a>.\r\n', '', 1275410616, 2),
