(1117, 1515, 1, 'Find our focus', 'This part of the investigation provides an introduction to micro-climates.', 'This part of the investigation provides an introduction to micro-climates.', '', 1285322332, 1),
(1118, 1516, 1, 'Decide our hypothesis', 'This part of your investigation is about deciding what your hypothesis is going to be. Your choice of hypothesis will affect what you need to measure and where.', 'This part of your investigation is about deciding what your hypothesis is going to be. Your choice of hypothesis will affect what you need to measure and where.', '', 1285322409, 1),
