(1122, 1520, 1, 'Write my report', 'This provides some of things you will need to write up your report.', 'This provides some of things you will need to write up your report.', '', 1285322383, 1),
(1123, 1521, 1, 'It is time to plan your investigation!', 'You now have three activities to carry out:\r\n<ul>\r\n<li>Decide on your group''s hypothesis</li>\r\n<li>Choose what you need to measure to test your hypothesis</li>\r\n<li>Choose where you need to measure to test your hypothesis</li>\r\n</ul>\r\nYou can also look at the introduction and the guidelines for how to write up your report', 'You now have three activities to carry out:\r\n<ul>\r\n<li>Decide on your group''s hypothesis</li>\r\n<li>Choose what you need to measure to test your hypothesis</li>\r\n<li>Choose where you need to measure to test your hypothesis</li>\r\n</ul>\r\nYou can also look at the introduction and the guidelines for how to write up your report', '', 1285322463, 1),
(1124, 1522, 1, 'It is time to collect your data!', 'You now have to collect data in each of your chosen locations and enter the data into the form.\r\n\r\nSelect the locations from the Activity Guide.\r\n\r\nYou should also take photographs at each location to record important features that could be affecting your readings.', 'You now have to collect data in each of your chosen locations and enter the data into the form.\r\n\r\nSelect the locations from the Activity Guide.\r\n\r\nYou should also take photographs at each location to record important features that could be affecting your readings.', '', 1285322434, 1),
(1125, 1523, 1, 'It is time to present your data and write your report!', 'You can now view your data table and select which photographs you will need for your report.\r\n\r\nTip: Look at your data before selecting your photos. That way you will know what you want your photos to show (e.g. photos of things being blown around to illustrate a wind tunnel or a photo of a damp area to illustrate high humidity).\r\n\r\nThe summary at the end shows all your work in one page. You can use this when writing your final report.', 'You can now view your data table and select which photographs you will need for your report.\r\n\r\nTip: Look at your data before selecting your photos. That way you will know what you want your photos to show (e.g. photos of things being blown around to illustrate a wind tunnel or a photo of a damp area to illustrate high humidity).\r\n\r\nThe summary at the end shows all your work in one page. You can use this when writing your final report.', '', 1285322451, 1),
