(516, 517, 'I don''t really think that finest meat will last longer than value but I think it will be of better quality - Sam\r\n\r\nI am Sam. Sam I am. Green eggs and ham. - Sam\r\n\r\nSam and Gemma will have the steaks. They will be in the fridge, in a ziplock bag. We will look at how the color changes, smell, weight, etc. We are trying to see which lasts longest, a) from each shop and b) finest or value.\r\nSainsbury''s and Tesco will be pitted against each other in the ultimate dual of the steaks!'),
(516, 562, 'I don''t really think that finest meat will last longer than value but I think it will be of better quality - Sam\r\n\r\nI think that the finest beef will last longer than the value because I think more care may have been taken with the packaging, which affects the quality and I just think it will be better than the value beef.-Sophie\r\n\r\nI am Sam. Sam I am. Green eggs and ham. - Sam\r\n\r\nSam and Gemma will have the steaks. They will be in the fridge, in a ziplock bag. We will look at how the color changes, smell, weight, etc. We are trying to see which lasts longest, a) from each shop and b) finest or value.\r\nSainsbury''s and Tesco will be pitted against each other in the ultimate dual of the steaks!'),
(525, 526, 'That the value peaches in packaging will last the longest because they contain the most chemicals and preservatives.  They also have packaging to keep them protected from germs and the moisture in the air. We think that finest peaches without packaging will last the shortest amount of time because they are the most organic and have come straight from being grown. They are also more exposed to the germs in the air and moisture.'),
(525, 534, 'That the finest bananas in packaging will last the longest because they contain the most chemicals and preservatives.  They also have packaging to keep them protected from germs and the moisture in the air. We think that the value bananas without packaging will last the shortest amount of time because they are the most organic and have come straight from being grown. They are also more exposed to the germs in the air and moisture.'),
(525, 561, 'We predict that the finest, packaged bananas will be the longer lasting. We think this because they will have more protection and due to them being finest and a larger price then they should be of a better quality. We also think that the value, unpackaged will rot the quickest. We think this because they are out of the packaging meaning they will be more exposed to moisture and bacteria. Also due to them being value this shows a lower price will lead to a lower standard.'),
(525, 563, 'We predict that the finest, packaged bananas will be the longer lasting. We think this because they will have more protection and due to them being finest and a larger price then they should be of a better quality. We also think that the value, unpackaged will rot the quickest. We think this because they are out of the packaging meaning they will be more exposed to moisture and bacteria. Also due to them being value this shows a lower price will lead to a lower standard. Kelly And Misha Smell.'),
