(891, 1061, 'Welcome to your Microclimates investigation. This is your Year 9 geography fieldwork investigation. We will find out more about local climates, called microclimates, and gather data from around the school. We''ll then analyse our data and draw some conclusions. Microclimates are areas where the normal temperature and conditions are slightly different from the surrounding areas. Most common microclimates are around large buildings such as shops, schools and office blocks.\r\n<!--break-->\r\nTo write up your experiment follow the format and include the information below:\r\n<p>\r\n   1. HYPOTHESIS: <br /><ul>\r\n          <li>Write out your hypothesis as a title for the experiment. This is what you are trying to prove or disprove.\r\n</ul>\r\n</p>\r\n<p>\r\n   2. EQUIPMENT: <br /><ul>\r\n          <li>List the equipment you needed to complete the experiment.\r\n          <li> Download relevant images from the Geography shared area of the equipment used.\r\n\r\n</ul>\r\n</p>\r\n<p>\r\n   3. METHOD:<br /><ul>\r\n          <li>Write the method (how you carried out the experiment) like a recipe so that someone else could follow your instructions. It must be detailed.\r\n          <li> Remember:\r\n<ul>\r\n                <li> The locations of each temperature reading\r\n                <li> How you used the digital thermometers to record temperatures around the school site.\r\n                <li> Include photos of the different areas tested\r\n                <li> Include relevant photos of the methods\r\n                <li> Label all photos e.g. This photo shows ...\r\n</ul>\r\n</ul>\r\n</p>\r\n<p>\r\n   4. RESULTS:<br /><ul>\r\n          <li> Produce a table and input the results recorded.\r\n          <li> Plot the data onto the school base map provided\r\n</ul>\r\n</p>\r\n<p>\r\n   5. ANALYSIS:<br /><ol>\r\n          * This section is where you must include figures and keywords to describe differences and similarities between the data recorded and give reasons.For example:\r\n               <li> Produce a graph (either on the paper provided or using an excel spreadsheet and clicking on the chart wizard button).\r\n                  Key words to include: REFLECTION, HEAT, ABSORBTION, THERMAL, WIND, SHELTER, ASPECT.\r\n               <li> To extend link the temperatures to urban and rural areas, reflection and absorption of heat on different surfaces and the concept of urban-heat-islands.\r\n               <li> Think about the prevailing wind directions and areas of the school site that are sheltered.\r\n</ol>\r\n</p>\r\n<p>\r\n   6. CONCLUSION:<br /><ul>\r\n          <li> Refer back to the hypothesis and state whether from the data collected it can be proved or disproved.\r\n          <li> What problems did you encounter in the experiment? (do not refer to individuals, think about the equipment, the surfaces etc).\r\n          <li> What could be done to improve or extend the experiment? (test a surface more times, different times of the year, different places, different vegetation covering etc).\r\n</ul>\r\n</p>\r\n');
