(1131, 1529, 'Microclimates are areas where the normal temperature and conditions are slightly different from the surrounding areas. Most common microclimates are around large buildings such as shops, schools and office blocks.\r\n\r\nSchool resources\r\n<ul>\r\n<li>Microclimates - PowerPoint introduction</li>\r\n</ul>'),
(1131, 1530, 'Microclimates are areas where the normal temperature and conditions are slightly different from the surrounding areas. Most common microclimates are around large buildings such as shops, schools and office blocks.\r\n\r\nSchool resources\r\n<ul>\r\n<li>Microclimates - <a href=''http://personalenquiry.open.ac.uk/pi/files/microclimate-survey.ppt'' target=''_new''>PowerPoint introduction</a></li>\r\n</ul>'),
(1131, 1531, 'Microclimates are areas where the normal temperature and conditions are slightly different from the surrounding areas. Most common microclimates are around large buildings such as shops, schools and office blocks.\r\n\r\nSchool resources\r\n<ul>\r\n<li>Microclimates - <a href=''http://personalenquiry.open.ac.uk/pi/files/microclimate-survey.ppt'' target=''_new''>PowerPoint introduction</a></li>\r\n</ul>'),
(1150, 1551, 'To write up your experiment follow the format and include the information below:\r\n<ol>\r\n<li>HYPOTHESIS:</li>\r\n<ul>\r\n<li>Write out your hypothesis as a title for the experiment. This is what you are trying to prove or disprove.</li>\r\n</ul>\r\n<li>EQUIPMENT:</li>\r\n<ul>\r\n<li>List the equipment you needed to complete the experiment.</li>\r\n<li>Download relevant images from the Geography shared area of the equipment used.</li>\r\n</ul>\r\n<li>METHOD:</li>\r\n<ul>\r\n<li>Write the method (how you carried out the experiment) like a recipe so that someone else could follow your instructions. It must be detailed.</li>\r\n<li>Remember:</li>\r\n<ul>\r\n<li>The locations of each temperature reading</li>\r\n<li>How you used the digital thermometers to record temperatures around the school site.</li>\r\n<li>Include photos of the different areas tested</li>\r\n<li>Include relevant photos of the methods</li>\r\n<li>Label all photos e.g. This photo shows ...</li>\r\n</ul>\r\n</ul>\r\n<li>RESULTS:</li>\r\n<ul>\r\n<li>Produce a table and input the results recorded.</li>\r\n<li>Plot the data onto the school base map provided</li>\r\n</ul>\r\n<li>ANALYSIS:</li>\r\n<ul>\r\n<li>This section is where you must include figures and keywords to describe differences and similarities between the data recorded and give reasons.For example:</li>\r\n<ol>\r\n<li>Produce a graph (either on the paper provided or using an excel spreadsheet and clicking on the chart wizard button).<br />\r\nKey words to include: REFLECTION, HEAT, ABSORBTION, THERMAL, WIND, SHELTER, ASPECT.</li>\r\n<li>To extend link the temperatures to urban and rural areas, reflection and absorption of heat on different surfaces and the concept of urban-heat-islands.</li>\r\n<li>Think about the prevailing wind directions and areas of the school site that are sheltered.</li>\r\n</ol>\r\n</ul>\r\n<li>CONCLUSION:</li>\r\n<ul>\r\n<li>Refer back to the hypothesis and state whether from the data collected it can be proved or disproved.</li>\r\n<li>What problems did you encounter in the experiment? (do not refer to individuals, think about the equipment, the surfaces etc).</li>\r\n<li>What could be done to improve or extend the experiment? (test a surface more times, different times of the year, different places, different vegetation covering etc).</li>\r\n</ul>\r\n</ol>\r\n\r\n'),
(1131, 1563, 'Microclimates are areas where the normal temperature and conditions are slightly different from the surrounding areas. Most common microclimates are around large buildings such as shops, schools and office blocks.\r\n\r\n<p>School resources</p>\r\n\r\n<ul>\r\n<li>Microclimates - <a href=''http://personalenquiry.open.ac.uk/pi/files/microclimate-survey.ppt'' target=''_new''>PowerPoint introduction</a></li>\r\n</ul>');
